import { Component } from '@angular/core';

@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.css']
})
export class RegistrationComponent {

  Email!:string;
  UserName!:string;
  PhoneNumber!:number;
  Password!:string;

  register(){
    alert("user registration successfull");
  }

}
<p>registration works!</p>
<table border="5" [cellPadding]="5" [cellSpacing]="5">
    <tr><td>Enter your username <input type="text" [(ngModel)]="UserName"></td></tr>
    <tr><td>Enter your Email Id <input type="text" [(ngModel)]="Email"></td></tr>
    <tr><td>Enter your Phone Number <input type=number [(ngModel)]="PhoneNumber"></td></tr>
    <tr><td>Set Password<input type="text" [(ngModel)]="Password"></td></tr>

</table>
<div>
    <button (click)="register()">Register</button>

</div>
